import styled from "styled-components";

const Section = styled.section`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  background-color: yellow;
`;

const P = styled.p`
  font-size: 1.5em;
`;

export { P, Section };
